import React from "react";
import { Language } from "../../../apis/model";
import "./languages.css";

interface Props {
  languages: Language[];
}

const Languages: React.FC<Props> = ({ languages }) => {
  const sortedHumanLanguages = languages
    .filter((e) => e.human === true)
    .sort((a, b) => a.priority - b.priority);
  return (
    <div className="languages" style={{}}>
      <h2>Communication</h2>
      <h3>with humans</h3>
      <ul className="list">
        {sortedHumanLanguages.map((language, index) => {
          return <LanguageItem {...{ language }} key={index} />;
        })}
      </ul>
      <h3>with maschines</h3>
      <ul className="list">
        {languages
          .filter((e) => e.human === false)
          .sort((a, b) => b.priority - a.priority)
          .map((language, index) => {
            return <LanguageItem {...{ language }} key={index} />;
          })}
      </ul>
    </div>
  );
};
export default Languages;

const LanguageItem = ({ language }: { language: Language }) => {
  return (
    <li className="list-item">
      <p>{language.lang}</p>
    </li>
  );
};
